import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { authRoutes, publicRoutes } from "../routes";
import { SHOP_ROUTE } from '../utils/constants';

const AppRouter = () => {
    // Защита от несуществующих маршрутов
    if (!publicRoutes || !Array.isArray(publicRoutes)) {
        throw new Error('publicRoutes is not defined or not an array');
    }
    if (!authRoutes || !Array.isArray(authRoutes)) {
        throw new Error('authRoutes is not defined or not an array');
    }

    const isAuth = false;
    const routes = isAuth ? [...authRoutes, ...publicRoutes] : publicRoutes;

    return (
        <Routes>
            {routes.map(({ path, Component }) =>
                <Route key={path} path={path} element={<Component />} />
            )}
            <Route path="*" element={<Navigate to={typeof SHOP_ROUTE !== 'undefined' ? SHOP_ROUTE : '/'} />} />
        </Routes>
    );
};

export default AppRouter;
